import React from "react";

function FormRow(name, value, type, email, password) {
  return (
    <div>
      <div className="form-row">
        <label htmlFor="name" className="form-label">
          name
        </label>
        <input
          type="text"
          value={values.name}
          name="name"
          onChange={handleChange}
          className="form-input"
        />
      </div>
    </div>
  );
}

export default FormRow;
